INSERT INTO venus.movie (del_yn,popularity,release_date,runtime,vote_average,id,reg_dt,upd_dt,vote_count,backdrop_path,original_language,original_title,poster_path,production_country,status,tagline,title,overview) VALUES (0,161.056,'1995-01-28',142,8.708,278,'2025-01-03 12:17:52.422037','2025-01-03 12:17:52.422042',27405,'http://image.tmdb.org/t/p/w200/zfbjgQE1uSd9wiPTX4VzsLi0rGG.jpg','en','The Shawshank Redemption','http://image.tmdb.org/t/p/w200/oAt6OtpwYCdJI76AVtVKW1eorYx.jpg','US','Released','두려움은 너를 죄수로 가두고 희망은 너를 자유롭게 하리라','쇼생크 탈출','촉망받는 은행 간부 앤디 듀프레인은 아내와 그녀의 정부를 살해했다는 누명을 쓴다. 주변의 증언과 살해 현장의 그럴듯한 증거들로 그는 종신형을 선고받고 악질범들만 수용한다는 지옥같은 교도소 쇼생크로 향한다. 인간 말종 쓰레기들만 모인 그곳에서 그는 이루 말할 수 없는 억압과 짐승보다 못한 취급을 당한다. 그러던 어느 날, 간수의 세금을 면제받게 해 준 덕분에 그는 일약 교도소의 비공식 회계사로 일하게 된다. 그 와중에 교도소 소장은 죄수들을 이리저리 부리면서 검은 돈을 긁어 모으고 앤디는 이 돈을 세탁하여 불려주면서 그의 돈을 관리하는데...');
INSERT INTO venus.movie (del_yn,popularity,release_date,runtime,vote_average,id,reg_dt,upd_dt,vote_count,backdrop_path,original_language,original_title,poster_path,production_country,status,tagline,title,overview) VALUES (0,151.643,'2009-07-15',153,7.687,767,'2025-01-03 12:17:54.027431','2025-01-03 12:17:54.027440',19515,'http://image.tmdb.org/t/p/w200/ze6Mx4QE5mQVXRYmG2flncqqle4.jpg','en','Harry Potter and the Half-Blood Prince','http://image.tmdb.org/t/p/w200/yrGlb3HLtjGp39mv4MJ5UuIHcj4.jpg','GB','Released','마지막 전투를 준비하라','해리 포터와 혼혈왕자','어둠의 세력이 더욱 강력해져 머글 세계와 호그와트까지 위협해온다. 위험한 기운을 감지한 덤블도어 교수는 다가올 전투에 대비하기 위해 해리 포터와 함께 대장정의 길을 나선다. 볼드모트를 물리칠 수 있는 유일한 단서이자 그의 영혼을 나누어 놓은 7개의 호크룩스를 파괴하는 미션을 수행해야만 하는 것! 또한 덤블도어 교수는 호크룩스를 찾는 기억여행에 결정적 도움을 줄 슬러그혼 교수를 호그와트로 초청한다. 한편 학교에서는 계속된 수업과 함께 로맨스의 기운도 무르익는다. 해리는 자신도 모르게 지니에게 점점 끌리게 되고, 새로운 여자 친구가 생긴 론에게 헤르미온느는 묘한 질투심을 느끼는데...');
INSERT INTO venus.movie (del_yn,popularity,release_date,runtime,vote_average,id,reg_dt,upd_dt,vote_count,backdrop_path,original_language,original_title,poster_path,production_country,status,tagline,title,overview) VALUES (0,154.176,'2022-12-14',192,7.6,76600,'2025-01-03 12:17:53.908985','2025-01-03 12:17:53.909005',12061,'http://image.tmdb.org/t/p/w200/8rpDcsfLJypbO6vREc0547VKqEv.jpg','en','Avatar: The Way of Water','http://image.tmdb.org/t/p/w200/u2aVXft5GLBQnjzWVNda7sdDpdu.jpg','US','Released','판도라의 바다, 새로운 세계가 펼쳐진다','아바타: 물의 길','판도라 행성에서 제이크 설리와 네이티리가 이룬 가족이 겪게 되는 무자비한 위협과 살아남기 위해 떠나야 하는 긴 여정과 전투, 그리고 견뎌내야 할 상처에 대한 이야기를 그렸다. 살아남기 위해 설리 가족이 숲에서 바다로 터전을 옮기면서 겪게 되는 화합의 과정, 그리고 곳곳에서 도사리는 새로운 위협까지 역경 속에서 더 아름답게 펼쳐진다.');
INSERT INTO venus.movie (del_yn,popularity,release_date,runtime,vote_average,id,reg_dt,upd_dt,vote_count,backdrop_path,original_language,original_title,poster_path,production_country,status,tagline,title,overview) VALUES (0,155.363,'2023-01-04',103,8.22,315162,'2025-01-03 12:17:53.678828','2025-01-03 12:17:53.678833',7878,'http://image.tmdb.org/t/p/w200/jr8tSoJGj33XLgFBy6lmZhpGQNu.jpg','en','Puss in Boots: The Last Wish','http://image.tmdb.org/t/p/w200/rKgvctIuPXyuqOzCQ16VGdnHxKx.jpg','US','Released','당신의 소원을 이루어 줄 2023년 새해 첫 어드벤처','장화신은 고양이: 끝내주는 모험','아홉 개의 목숨 중 단 하나의 목숨만 남은 장화신은 고양이.  마지막 남은 목숨을 지키기 위해 히어로의 삶 대신 반려묘의 삶을 선택한 그에게 찾아온 마지막 기회, 바로 소원을 들어주는 소원별이 있는 곳을 알려주는 지도!  잃어버린 목숨을 되찾고 다시 히어로가 되기를 꿈꾸는 장화신은 고양이는 뜻밖에 동료가 된 앙숙 파트너 ''키티 말랑손'', 그저 친구들과 함께라면 모든 게 행복한 강아지 ''페로''와 함께 소원별을 찾기 위해 길을 떠난다.  그리고 소원별을 노리는 또 다른 빌런들과 마주치게 되는데…');
INSERT INTO venus.movie (del_yn,popularity,release_date,runtime,vote_average,id,reg_dt,upd_dt,vote_count,backdrop_path,original_language,original_title,poster_path,production_country,status,tagline,title,overview) VALUES (0,127.835,'2023-07-19',114,7.0,346698,'2025-01-03 12:17:54.109481','2025-01-03 12:17:54.109486',9323,'http://image.tmdb.org/t/p/w200/mbYTRO33LJAgpCMrIn9ibiWHbMH.jpg','en','Barbie','http://image.tmdb.org/t/p/w200/h3mUJ9WEJ8PzA450ad4hrjsaiqG.jpg','GB','Released','바비는 무엇이든 될 수 있어','바비','원하는 무엇이든 될 수 있는 바비랜드에서 살아가던 바비가 현실 세계와 이어진 포털의 균열을 발견하게 되고, 이를 해결하기 위해 켄과 예기치 못한 여정을 떠나면서 펼쳐지는 이야기');
INSERT INTO venus.movie (del_yn,popularity,release_date,runtime,vote_average,id,reg_dt,upd_dt,vote_count,backdrop_path,original_language,original_title,poster_path,production_country,status,tagline,title,overview) VALUES (0,159.312,'2022-06-22',131,8.194,361743,'2025-01-03 12:17:52.400177','2025-01-03 12:17:52.400180',9353,'http://image.tmdb.org/t/p/w200/AaV1YIdWKnjAIAOe8UUKBFm327v.jpg','en','Top Gun: Maverick','http://image.tmdb.org/t/p/w200/jeqXUwNilvNqNXqAHsdwm5pEfae.jpg','US','Released','한순간의 실수도 용납되지 않는 하늘 위, 가장 압도적인 비행이 시작된다','탑건: 매버릭','최고의 파일럿이자 전설적인 인물 매버릭은 자신이 졸업한 훈련학교 교관으로 발탁된다. 그의 명성을 모르던 팀원들은 매버릭의 지시를 무시하지만 실전을 방불케 하는 상공 훈련에서 눈으로 봐도 믿기 힘든 전설적인 조종 실력에 모두가 압도된다. 매버릭의 지휘 아래 견고한 팀워크를 쌓아가던 팀원들에게 국경을 뛰어넘는 위험한 임무가 주어지자 매버릭은 자신이 가르친 동료들과 함께 마지막이 될지 모를 하늘 위 비행에 나서는데...');
INSERT INTO venus.movie (del_yn,popularity,release_date,runtime,vote_average,id,reg_dt,upd_dt,vote_count,backdrop_path,original_language,original_title,poster_path,production_country,status,tagline,title,overview) VALUES (0,277.975,'2023-05-17',142,7.07,385687,'2025-01-03 12:17:49.852894','2025-01-03 12:17:49.852907',5658,'http://image.tmdb.org/t/p/w200/4XM8DUTQb3lhLemJC51Jx4a2EuA.jpg','en','Fast X','http://image.tmdb.org/t/p/w200/cltj9nKLzl0HXtz2qdu55BoIgOn.jpg','US','Released','달리거나 죽거나, 그들의 마지막 질주가 시작된다!','분노의 질주: 라이드 오어 다이','돔과 그의 패밀리 앞에 나타난 운명의 적 단테. 과거의 그림자는 돔의 모든 것을 파괴하기 위해 달려온다. 단테에 의해 산산히 흩어진 패밀리들은 모두 목숨을 걸고 맞서야 하는 함정에 빠지고 마는데...');
INSERT INTO venus.movie (del_yn,popularity,release_date,runtime,vote_average,id,reg_dt,upd_dt,vote_count,backdrop_path,original_language,original_title,poster_path,production_country,status,tagline,title,overview) VALUES (0,2156.489,'2024-11-20',162,7.425,402431,'2025-01-03 12:17:47.886202','2025-01-03 12:17:47.886242',865,'http://image.tmdb.org/t/p/w200/uVlUu174iiKhsUGqnOSy46eIIMU.jpg','en','Wicked','http://image.tmdb.org/t/p/w200/mHozMgx7w29qC9gLzUQDQEP7AEM.jpg','US','Released','마법 같은 운명의 시작','위키드','자신의 진정한 힘을 아직 발견하지 못한 엘파바와 자신의 진정한 본성을 발견하지 못한 글린다, 전혀 다른 두 인물이 우정을 쌓아가며 맞닥뜨리는 예상치 못한 위기와 모험을 그린 이야기');
INSERT INTO venus.movie (del_yn,popularity,release_date,runtime,vote_average,id,reg_dt,upd_dt,vote_count,backdrop_path,original_language,original_title,poster_path,production_country,status,tagline,title,overview) VALUES (0,182.568,'2023-04-26',93,7.639,502356,'2025-01-03 12:17:52.375516','2025-01-03 12:17:52.375521',9281,'http://image.tmdb.org/t/p/w200/cFBreBMAuE578QOFwSGHQpnH9En.jpg','en','The Super Mario Bros. Movie','http://image.tmdb.org/t/p/w200/jt1GlLLvkWL2m83VX8I1qsDR187.jpg','JP','Released','동생을 구하기 위해! 세상을 지키기 위해! ''슈퍼 마리오''로 레벨업하기 위한 ''마리오''의 스펙터클한 스테이지가 시작된다!','슈퍼 마리오 브라더스','따단-딴-따단-딴 ♫ 전 세계를 열광시킬 올 타임 슈퍼 어드벤처의 등장! 뉴욕의 평범한 배관공 형제 ''마리오''와 ‘루이지’는 배수관 고장으로 위기에 빠진 도시를 구하려다 미스터리한 초록색 파이프 안으로 빨려 들어가게 된다. 파이프를 통해 새로운 세상으로 차원 이동하게 된 형제. 형 ''마리오''는 뛰어난 리더십을 지닌 ''피치''가 통치하는 버섯왕국에 도착하지만 동생 ''루이지''는 빌런 ''쿠파''가 있는 다크랜드로 떨어지며 납치를 당하고 ‘마리오’는 동생을 구하기 위해 ‘피치’와 ‘키노피오’의 도움을 받아 ''쿠파''에 맞서기로 결심한다. 그러나 슈퍼스타로 세상을 지배하려는 그의 강력한 힘 앞에 이들은 예기치 못한 위험에 빠지게 되는데...!');
INSERT INTO venus.movie (del_yn,popularity,release_date,runtime,vote_average,id,reg_dt,upd_dt,vote_count,backdrop_path,original_language,original_title,poster_path,production_country,status,tagline,title,overview) VALUES (0,743.122,'2024-07-24',94,7.1,519182,'2025-01-03 12:17:48.127033','2025-01-03 12:17:48.127056',2361,'http://image.tmdb.org/t/p/w200/lgkPzcOSnTvjeMnuFzozRO5HHw1.jpg','en','Despicable Me 4','http://image.tmdb.org/t/p/w200/5hl1PEpAvZ8Ok37kB7woIssHi3X.jpg','US','Released','올여름은 우리가 씹어 먹는다!','슈퍼배드 4','슈트-업 하고 악당 전담 처리반 AVL이 된 에이전트 미니언즈와 미니언즈 만큼 귀여운 그루 주니어가 태어나면서 더욱 완벽해진 그루 패밀리. 이들 앞에 과거 그루의 고등학교 동창이자 그에게 체포당했던 빌런 맥심이 등장하고, 오직 그루를 향한 복수심에 불타올라 탈옥까지 감행한 맥심은 그루 패밀리의 뒤를 바짝 추격하며 위협을 가하기 시작하는데... 과연 에이전트 미니언즈와 그루 패밀리는 맥심을 막아낼 수 있을까?');
INSERT INTO venus.movie (del_yn,popularity,release_date,runtime,vote_average,id,reg_dt,upd_dt,vote_count,backdrop_path,original_language,original_title,poster_path,production_country,status,tagline,title,overview) VALUES (0,886.781,'2024-07-24',128,7.7,533535,'2025-01-03 12:17:48.116050','2025-01-03 12:17:48.116070',6159,'http://image.tmdb.org/t/p/w200/by8z9Fe8y7p4jo2YlW2SZDnptyT.jpg','en','Deadpool & Wolverine','http://image.tmdb.org/t/p/w200/8beFmkVCbl88nqc5CUO7kE5Z2W5.jpg','US','Released','','데드풀과 울버린','히어로 생활에서 은퇴한 후, 평범한 중고차 딜러로 살아가던 ‘데드풀’이 예상치 못한 거대한 위기를 맞아 모든 면에서 상극인 ‘울버린’을 찾아가게 되며 펼쳐지는 도파민 폭발 액션 블록버스터.');
INSERT INTO venus.movie (del_yn,popularity,release_date,runtime,vote_average,id,reg_dt,upd_dt,vote_count,backdrop_path,original_language,original_title,poster_path,production_country,status,tagline,title,overview) VALUES (0,5382.147,'2024-11-13',148,6.8,558449,'2025-01-03 12:17:47.184095','2025-01-03 12:17:47.184119',1840,'http://image.tmdb.org/t/p/w200/euYIwmwkmz95mnXvufEmbL6ovhZ.jpg','en','Gladiator II','http://image.tmdb.org/t/p/w200/b5UXjzW5cLZhprMnlAmsVAA3G4t.jpg','US','Released','역사로 기억될 새로운 반란이 시작된다!','글래디에이터 II','로마의 영웅이자 최고의 검투사였던 막시무스가 콜로세움에서 죽음을 맞이한 뒤 20여 년이 흐른 후. 쌍둥이 황제 게타와 카라칼라의 폭압 아래 시민을 위한 자유로운 나라 로마의 꿈은 잊힌 지 오래다. 한편 아카시우스 장군이 이끄는 로마군에 대패한 후 모든 것을 잃고 노예로 전락한 루시우스는 강한 권력욕을 지닌 마크리누스의 눈에 띄어 검투사로 발탁된다. 로마를 향한 걷잡을 수 없는 분노, 타고난 투사의 기질로 콜로세움에 입성하게 된 루시우스는 결투를 거듭하며 자신이 진짜 누구인지 알게 되고 마침내 로마의 운명을 건 결전을 준비하게 되는데...!');
INSERT INTO venus.movie (del_yn,popularity,release_date,runtime,vote_average,id,reg_dt,upd_dt,vote_count,backdrop_path,original_language,original_title,poster_path,production_country,status,tagline,title,overview) VALUES (0,196.645,'2023-06-21',140,8.355,569094,'2025-01-03 12:17:51.578148','2025-01-03 12:17:51.578153',7129,'http://image.tmdb.org/t/p/w200/jbthbh0KzaUWFPYvkfmXAamjI8j.jpg','en','Spider-Man: Across the Spider-Verse','http://image.tmdb.org/t/p/w200/lMWTlGr9jVUC18T515hPRKym5QQ.jpg','US','Released','한 명을 구할 것인가, 모두를 구할 것인가','스파이더맨: 어크로스 더 유니버스','여러 성장통을 겪으며 새로운 스파이더맨이 된 마일스 모랄레스. 그 앞에 다른 평행세계의 스파이더우먼 그웬이 다시 나타난다. 모든 차원의 멀티버스 속 스파이더맨들을 만나게 되지만, 질서에 대한 신념이 부딪히며 예상치 못한 균열이 생기는데… 상상 그 이상을 넘어서는 멀티버스의 세계가 열린다!');
INSERT INTO venus.movie (del_yn,popularity,release_date,runtime,vote_average,id,reg_dt,upd_dt,vote_count,backdrop_path,original_language,original_title,poster_path,production_country,status,tagline,title,overview) VALUES (0,390.507,'2024-06-06',115,7.466,573435,'2025-01-03 12:17:49.066089','2025-01-03 12:17:49.066106',2530,'http://image.tmdb.org/t/p/w200/tncbMvfV0V07UZozXdBEq4Wu9HH.jpg','en','Bad Boys: Ride or Die','http://image.tmdb.org/t/p/w200/wIrhEUBWjRmZuL1Ix41cF2LhJrW.jpg','US','Released','용의자가 된 나쁜 녀석들의 화끈한 수사가 시작된다!','나쁜 녀석들: 라이드 오어 다이','마이애미 강력반 최고의 콤비 마이크와 마커스. 가족 같은 하워드 반장이 사망 전 마약 카르텔 조직의 비리에 연루되었다는 뉴스 속보를 접하게 된다. 하지만 아무도 믿지 말라는 하워드 반장의 비밀 메시지를 받은 마이크와 마커스 형사는 사건의 진실을 밝히기 위해 위험한 수사를 시작한다. 서서히 드러나는 거대한 음모와 마주하게 된 나쁜 녀석들. 그러나 이들 역시 함정에 빠져 사건의 용의자로 지목되며 동료 경찰들은 물론 마약 카르텔 조직에게도 쫓기는 신세가 되고 마는데…');
INSERT INTO venus.movie (del_yn,popularity,release_date,runtime,vote_average,id,reg_dt,upd_dt,vote_count,backdrop_path,original_language,original_title,poster_path,production_country,status,tagline,title,overview) VALUES (0,269.925,'2024-11-22',110,6.81,592983,'2025-01-03 12:17:49.842814','2025-01-03 12:17:49.842826',184,'http://image.tmdb.org/t/p/w200/n4ycOGj2tRLfINTJQ3wl0vNYqpR.jpg','en','Spellbound','http://image.tmdb.org/t/p/w200/2s3ilM1Oe28zOnxvUCTqVyO8jYZ.jpg','ES','Released','','엘리안과 빛나는 마법 모험','부모님이 강력한 마법의 주문에 걸려 괴물로 변해버리자, 10대 소녀 엘리안 공주는 더 늦기 전에 저주를 풀고자 바깥세상으로 모험을 떠난다.');
INSERT INTO venus.movie (del_yn,popularity,release_date,runtime,vote_average,id,reg_dt,upd_dt,vote_count,backdrop_path,original_language,original_title,poster_path,production_country,status,tagline,title,overview) VALUES (0,208.024,'2023-04-12',170,7.7,603692,'2025-01-03 12:17:51.856489','2025-01-03 12:17:51.856498',6655,'http://image.tmdb.org/t/p/w200/7I6VUdPj6tQECNHdviJkUHD2u89.jpg','en','John Wick: Chapter 4','http://image.tmdb.org/t/p/w200/h3LsdSBzhRnBebz4BTpAhh63PD3.jpg','DE','Released','돌아갈 길은 없고, 앞으로 나아갈 길만 있다!','존 윅 4','죽을 위기에서 살아난 존 윅은 최고 회의를 쓰러트릴 방법을 찾아낸다. 비로소 완전한 자유의 희망을 보지만, 빌런 그라몽 후작과 전 세계의 최강 연합은 존 윅의 오랜 친구까지 적으로 만들어 버리고, 새로운 위기에 놓인 존 윅은 최후의 반격을 준비하는데...');
INSERT INTO venus.movie (del_yn,popularity,release_date,runtime,vote_average,id,reg_dt,upd_dt,vote_count,backdrop_path,original_language,original_title,poster_path,production_country,status,tagline,title,overview) VALUES (0,311.651,'2024-05-15',104,7.188,639720,'2025-01-03 12:17:49.331083','2025-01-03 12:17:49.331098',1149,'http://image.tmdb.org/t/p/w200/nxxCPRGTzxUH8SFMrIsvMmdxHti.jpg','en','IF','http://image.tmdb.org/t/p/w200/os1AE0MWPu1S1gcfKxosDv9fwuP.jpg','US','Released','믿어야만 보이는 세계가 열린다','이프: 상상의 친구','상상의 친구 ‘이프’를 볼 수 있는 능력을 지닌 한 소녀가 아이들에게 잊혀졌던 ‘이프’를 다시 되찾아주기 위해 마법 같은 모험을 시작하는 이야기를 그린 영화');
INSERT INTO venus.movie (del_yn,popularity,release_date,runtime,vote_average,id,reg_dt,upd_dt,vote_count,backdrop_path,original_language,original_title,poster_path,production_country,status,tagline,title,overview) VALUES (0,406.161,'2024-12-04',95,7.2,645757,'2025-01-03 12:17:49.025549','2025-01-03 12:17:49.025575',287,'http://image.tmdb.org/t/p/w200/rWs3Q9bT7zCH6t004z67UGuWUwu.jpg','en','That Christmas','http://image.tmdb.org/t/p/w200/p6O13TK2JzEZAvKFkjJisz1tkYl.jpg','GB','Released','','그해 크리스마스에는','역사상 최악의 눈보라가 산타클로스를 포함한 모두의 계획을 틀어지게 한 그날. 웰링턴온씨 마을 사람들에게 잊지 못할 크리스마스가 펼쳐진다.');
INSERT INTO venus.movie (del_yn,popularity,release_date,runtime,vote_average,id,reg_dt,upd_dt,vote_count,backdrop_path,original_language,original_title,poster_path,production_country,status,tagline,title,overview) VALUES (0,164.567,'2024-09-06',132,6.999,646097,'2025-01-03 12:17:52.328654','2025-01-03 12:17:52.328658',1082,'http://image.tmdb.org/t/p/w200/cyKH7pDFlxIXluqRyNoHHEpxSDX.jpg','en','Rebel Ridge','http://image.tmdb.org/t/p/w200/ltAyMY5j73LtIqTzlFwPlfZb1K.jpg','US','Released','','레블 리지','작은 도시를 방문한 전직 해병대원. 사촌의 보석 신청에 쓰려던 현금 가방을 관할 경찰에게 부당하게 압수당하자 그곳에 만연한 부패에 정면으로 맞서기로 한다.');
INSERT INTO venus.movie (del_yn,popularity,release_date,runtime,vote_average,id,reg_dt,upd_dt,vote_count,backdrop_path,original_language,original_title,poster_path,production_country,status,tagline,title,overview) VALUES (0,306.505,'2024-05-08',145,7.101,653346,'2025-01-03 12:17:49.308553','2025-01-03 12:17:49.308576',3385,'http://image.tmdb.org/t/p/w200/iHYh4cdO8ylA3W0dUxTDVdyJ5G9.jpg','en','Kingdom of the Planet of the Apes','http://image.tmdb.org/t/p/w200/caNBYk7beRAg8Tcpe7ZjzM2nYXH.jpg','US','Released','세상의 주인이 바뀌었다','혹성탈출: 새로운 시대','진화한 유인원과 퇴화된 인간들이 살아가는 땅. 유인원 리더 프록시무스는 완전한 군림을 위해 인간들을 사냥하며 자신의 제국을 건설한다. 한편, 또 다른 유인원 노아는 우연히 숨겨진 과거의 이야기와 시저의 가르침을 듣게 되고 인간과 유인원이 함께 할 새로운 세상을 꿈꾼다. 어느 날 그의 앞에 나타난 의문의 한 인간 소녀. 노아는 그녀와 함께 자유를 향한 여정을 시작하게 되는데…');
